import React from 'react';
import './App.css';
import Register from './components/Registerjs';
import {BrowserRouter as Router ,Switch, Route} from "react-router-dom";
import Login from './components/Login';



function App() {

  return (
    <>
    <Router>
      <Switch>
        <Route path ="/login">
          <Login/>
        </Route>
        <Route path ="/register">
          <Register/>
        </Route>
      </Switch>
    </Router>




    </>
  );
}

export default App;
